import React, { useState } from "react";
import { useTable } from "react-table";
import data from "./book-data.json";

function UserTable (){

const [books, setBooks] = useState(data);


    return (
        <div className = "user-table">
            <table> 
                <thead>
                <tr>
                    <th>Title</th>
                    <th>Author</th>
                    <th>Year</th>
                    <th>Condition</th>
                    <th>Genre</th>
                    <th>ISBN Number</th>
                </tr>
                </thead>
                <tbody>
                    {books.map((book) => (
                        <tr>
                            <td>{book.title}</td>
                            <td>{book.author}</td>
                            <td>{book.year}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}
export default UserTable;
